import React from 'react';
import { useHistory } from "react-router-dom";


function E_booklick(props) {

    const history = useHistory();
    const booklistsPromedioContenido = () => {
        history.push(`/booklistsPromedioContenido_db_get/`);
    };

    return (
    <div className="content">
        <div className="">
            <div className="page-header-title">
            <h4 className="page-title">Estad√≠sticas Booklick</h4>
                <div id="textRight">
                    <button type="button" className="btn btn-success waves-effect waves-light"
                        onClick={booklistsPromedioContenido} id="textCenter">Contenido Promedio Booklists
                    </button>
                    <button type="button" className="btn btn-success waves-effect waves-light"
                        onClick=" window.location.href='/booklistsCarrera_db_get/' " id="textCenter">Booklists por carrera
                    </button>
                    <button type="button" className="btn btn-success waves-effect waves-light"
                        onClick=" window.location.href='/booklistsRango_db_get/' " id="textCenter">Booklists rango
                    </button>
                </div>
            </div>
        </div>
        <br></br>
    </div>
    );
}

export default E_booklick;
